  html: "\r\n\t\t\t\r\n\t\t\tJordan Carver l&#xE0; m&#x1ED9;t ng&#x1B0;&#x1EDD;i m&#x1EAB;u n&#x1ED5;i ti&#x1EBF;ng nh&#x1EDD; khu&#xF4;n m&#x1EB7;t thanh t&#xFA; v&#xE0; v&#xF2;ng 1 ngo&#x1EA1;i c&#x1EE1;. M&#x1EDB;i &#x111;&#xE2;y, ng&#x1B0;&#x1EDD;i &#x111;&#x1EB9;p &#xDD; &#x111;&#xE3; tr&#xEC;nh l&#xE0;ng m&#x1ED9;t b&#x1ED9; &#x1EA3;nh t&#x1EAD;p Yoga b&#x1EAF;t m&#x1EAF;t, v&#x1EDB;i nhi&#x1EC1;u &#x111;&#x1ED9;ng t&#xE1;c &#x111;i&#xEA;u luy&#x1EC7;n.<br>\r\n<img src=\"http://giaoduc.net.vn/Uploaded/nguyendinh/2012_02_08/Sieu-mau-Jordan-Carver-vong-1-khung-Yoga%20(1).jpg\" border=\"0\" alt=\"\"><br>\r\n<img src=\"http://giaoduc.net.vn/Uploaded/nguyendinh/2012_02_08/Sieu-mau-Jordan-Carver-vong-1-khung-Yoga%20%282%29.jpg\" border=\"0\" alt=\"\"><br>\r\n<img src=\"http://giaoduc.net.vn/Uploaded/nguyendinh/2012_02_08/Sieu-mau-Jordan-Carver-vong-1-khung-Yoga%20%286%29.jpg\" border=\"0\" alt=\"\"><br>\r\n<img src=\"http://giaoduc.net.vn/Uploaded/nguyendinh/2012_02_08/Sieu-mau-Jordan-Carver-vong-1-khung-Yoga%20%2811%29.jpg\" border=\"0\" alt=\"\"><br>\r\n<img src=\"images/smilies/brick.png\" border=\"0\" alt=\"\" title=\"Brick\" class=\"inlineimg\"><img src=\"images/smilies/brick.png\" border=\"0\" alt=\"\" title=\"Brick\" class=\"inlineimg\"><img src=\"images/smilies/brick.png\" border=\"0\" alt=\"\" title=\"Brick\" class=\"inlineimg\"><img src=\"images/smilies/brick.png\" border=\"0\" alt=\"\" title=\"Brick\" class=\"inlineimg\">\r\n\t\t"
  text: >-
    Jordan Carver là một người mẫu nổi tiếng nhờ khuôn mặt thanh tú và vòng 1
    ngoại cỡ. Mới đây, người đẹp Ý đã trình làng một bộ ảnh tập Yoga bắt mắt,
